/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Fragment } from 'react';
import Link from 'next/link';
import { Button, InputGroup, FormControl } from 'react-bootstrap';

const Header = (props) => {
  // console.log(Button);
  const onClick = () => {
    alert('button Click');
  };
  return (
    <Fragment>
      <div id="header">
        <div className="header_container">
          <div className="logo">
            <span>logo</span>
          </div>
          <div className="search">
            <InputGroup className="mb-3">
              <FormControl
                placeholder="Username"
                aria-label="Username"
                aria-describedby="basic-addon1"
                id="hello"
              />
              <Button onClick={onClick}>
                <i className="fa fa-search" aria-hidden="false" />
              </Button>
            </InputGroup>
          </div>
          <div className="menu">
            <ul>
              <li>
                <Link href="/">
                  <a>Index</a>
                </Link>
              </li>
              <li>
                <Link href="/login">
                  <a>Login</a>
                </Link>
              </li>
            </ul>
          </div>
        </div>
      </div>
      <style jsx>
        {`
          .header_container{
            width:1200px;
            overflow:hidden;
          }
          .logo, .search{
            float:left;
          }
          .menu{
            float:right;
          }
        `}
      </style>
    </Fragment>
  );
};

export default Header;
